import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">Logo</div>
        <ul>
          <li>Accueil</li>
          <li>Services</li>
          <li>À propos</li>
          <li>Contact</li>
          <button className="nav-button">Rejoindre</button>
          <button className="nav-button">En savoir plus</button>
        </ul>
      </nav>

      {/* Hero Section */}
      <div className="hero">
        <div className="hero-content">
          <h1>
            Sauvez des vies, <br /> donnez votre sang
          </h1>
          <p>
            Chaque don de sang peut sauver jusqu’à trois vies. Rejoignez-nous
            dans cette noble cause et faites la différence aujourd’hui.
          </p>
          <button className="cta-button">S'inscrire</button>
        </div>
      </div>
     
    </div>
 
    
    
  );
};

export default HomePage;
